import React from 'react';
import { Box } from '@mui/material';

const Component1 = () => {
  return (
    <Box
      sx={{
        width: '15%',
        bgcolor: '#f5f5f5',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        p: 2,
      }}
    >
      {/* Avatar hình tròn */}
      <Box
        sx={{
          width: 50,
          height: 50,
          borderRadius: '50%',
          bgcolor: '#bbb',
          mb: 4, // Thêm khoảng cách lớn hơn bên dưới avatar
        }}
      ></Box>

      {/* Danh sách các ô group */}
      <Box
        sx={{
          width: '80%',
          bgcolor: '#e0e0e0',
          height: '50%',
          mt: 4, // Tăng khoảng cách giữa avatar và danh sách ô
          p: 1,
          display: 'flex',
          flexDirection: 'column',
          gap: 2, // Tăng khoảng cách giữa các ô bên trong
        }}
      >
        {[1, 2, 3].map((item) => (
          <Box
            key={item}
            sx={{
              width: '100%',
              height: 50,
              bgcolor: '#ddd',
              borderRadius: 1,
            }}
          ></Box>
        ))}
      </Box>
    </Box>
  );
};

export default Component1;
